(ns calm-summit
  (:require [gorilla-plot.core :as plot]
            [gorilla-repl.html :as html]
            [gg4clj.core :as gg4clj]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def xs (range 0 10 0.1))
(def ys (map #(Math/sin %) xs))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;calm-summit/ys</span>","value":"#'calm-summit/ys"}
;; <=

;; @@
(def dat {:x xs :y ys})
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;calm-summit/dat</span>","value":"#'calm-summit/dat"}
;; <=

;; @@
(def plot
  [[:<- :d (gg4clj/data-frame dat)]
   [:+
    [:qplot :x :y {:data :d :geom [:c "point" "smooth"] :span 1}]
    [:theme_bw]]])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;calm-summit/plot</span>","value":"#'calm-summit/plot"}
;; <=

;; @@
(html/html-view (gg4clj/render-ggplot plot))
